description:
The boys are back to discuss their wild vidcon experiences, their performance with the drag queens from RuPauls Drag Race, and Zach's food poisoning. 
New Episodes of the TryPod come out every Thursday. Rate, subscribe, and tell us a secret in the comments so we can read them on a future episode!
